import React from "react";
import App from "next/app";
import Head from "next/head";

class MyApp extends App {

  render() {

    const { Component, pageProps, store } = this.props;


    return (
      <div style={{}}>

          <Head>
            <meta name="viewport" content="width=device-width, initial-scale=1.0"/>
            <link href='https://fonts.googleapis.com/css?family=Muli:400,700' rel='stylesheet' type='text/css'></link>
            <link href="https://fonts.googleapis.com/css?family=Poppins:400,600" rel="stylesheet" type='text/css'></link>            
          </Head>


          <Component {...pageProps} />


      </div>
    );
  }
}

export default MyApp;
